document.addEventListener('DOMContentLoaded', function () {
    let modal = document.querySelector('.modal_discount'),
      close = document.querySelector('.modal_discount_close');
    modal.classList.add('active-modall');
    close.addEventListener('click', () => {
      modal.classList.add('hidden');
      localStorage.setItem('modaldisc3', 'true');
    })
    if (localStorage.getItem('modaldisc3') == 'true') {
      modal.classList.add('hidden');
    }
})

